import React from 'react';
import "./style.scss";

export default function ContactMe() {
    return (
      <div className="contact-page">
          <div id="content">
              <div id="header">
                  That's enough about me. <br/>
                  Let's talk about you.
              </div>
              <p>
                  Have suggestions for my website? Interested in working with me?
                  Feel free to leave a message.
              </p>
          </div>
          <div className="form">

          </div>
      </div>
    );
};
